import { React, useState } from "react";
import Header from "./components/Login/Header1";
import Navbar1 from "./components/Navbar1";
import BeitragDeck from "./components/Browsing/BeitragDeck";
import { Container } from "react-bootstrap";
import Beitrag from "./components/Beitrag"

const IndexPage = () => {
  const [beitraege, setBeitraege] = useState(0);
  if (beitraege.forEach === undefined) {
    fetchdata("Entdecke/?Page=0&seed=1")
      .then((response) => response.json())
      .then((data) => {
        setBeitraege(data.beitraege);

        console.log(beitraege)
      });
  }
  else{
    console.log(beitraege.forEach)
  }

  if (beitraege.forEach === undefined) return <h3>noch nicht geladen</h3>;
  
  return (
    <div>
      <Navbar1 className="m-0"></Navbar1>
      <Header str="Entdecke" className="m-0"></Header>

      <BeitragDeck data = {beitraege}></BeitragDeck>
    </div>
  );
};

export default IndexPage;

async function fetchdata(url) {
  return await fetch(localStorage.ip + url);
}
